insert  into `others`(`id`,`module`,`title`,`content`,`create_time`,`update_time`) values (3,'guide','新人指南','提醒方式:定时提醒，提醒创建后，到了提醒时间会在微信服务通知内收到提醒。\r\n\r\n提醒声音:提醒声音与微信消息的通知提示音是一样的\r\n\r\n如何快速的找到我？\r\n1.点击右上角添加到我的小程序\r\n2.聊天界面下拉就可以找到\r\n\r\n如何关闭提醒:待提醒页面点击需要关闭的提醒，然后删除即可','2022-06-02 07:19:55','2022-06-02 07:19:55'),(4,'about','关于我们','Re是一款致力于提醒物品临期，减少物品不必要浪费的小程序。\r\n\r\n希望大家多多支持，多多使用。你们的支持，就是我们继续下去的动力。\r\n\r\n微信小程序正在努力升级调整中，我们尽力跟上小程序的每次更新。若您有发现任何BUG、使用疑问或者是有其他建议，请发送邮件至3010273040@qq.com，或是直接于“意见与反馈”模块发送信息，我们会及时给您反馈。','2022-06-02 07:20:09','2022-06-02 07:20:09');

